import React from "react";
import NavIcon from "./NavIcon";
import '../style/nav.scss';

export default function Header(props){
    let currTime = Date();

    return(
        <header className="header">
            <h2>{props.title}</h2>
            <p>Thurs July 18</p>
            <p>{currTime}</p>
            <div className="account">
                <NavIcon img="/assets/icons/tables/notification-icon.svg" />
                <NavIcon img="/assets/icons/tables/notification-icon.svg" />
                <p>{props.userName}</p>
                <NavIcon img={props.pfp} />
            </div>
        </header>
    )
}
